import React from "react";
import './LeftNav.css';
import linked from '../src/assets/linkedin-icon.svg';
import gitHub from '../src/assets/left-nav-git-link.svg';
import insta from '../src/assets/left-nav-insta-link.svg';
import blackJack from '../src/assets/left-nav-blackjack-link.png';
import dice from '../src/assets/left-nav-dice-link.png';
import logo from '../src/assets/logo.png';
import Globe from "./Globe";
import Blackjack from "./BlackJack";



export default function LeftNav() {

    return (
        <div className="left-nav-container">
            <a id='logo' href="#" target="#"><img id="logo"  src={logo} alt="logo"/></a>
            <div class="links-container">
            <svg
        xmlns="http://www.w3.org/2000/svg"
        width="24"
        height="24"
        viewBox="0 0 24 24"
        className="svg-icon"
    >
        <path
            d="M0 120c0-33.334 11.667-60.834 35-82.5C58.333 15.833 88.667 5 126 5c36.667 0 66.333 10.666 89 32 23.333 22 35 50.666 35 86 0 32-11.333 58.666-34 80-23.333 22-54 33-92 33h-1c-36.667 0-66.333-11-89-33S0 153.333 0 120zm13 875V327h222v668H13zm345 0h222V622c0-23.334 2.667-41.334 8-54 9.333-22.667 23.5-41.834 42.5-57.5 19-15.667 42.833-23.5 71.5-23.5 74.667 0 112 50.333 112 151v357h222V612c0-98.667-23.333-173.5-70-224.5S857.667 311 781 311c-86 0-153 37-201 111v2h-1l1-2v-95H358c1.333 21.333 2 87.666 2 199 0 111.333-.667 267.666-2 469z"
            fill="#fff"
            className="svg-path"
        />
    </svg>
            <div id="left-nav-two" class="links"><a href="../https://github.com/trevarious" target="_blank"><img class="left-nav-links-img" src={gitHub} alt="" /></a></div>
            <div id="left-nav-three" class="links"><a href="../https://instagram.com"><img class="left-nav-links-img" src={insta} alt="" /></a></div>
            <div id="left-nav-four" class="links"><a href="https://instagram.com"><img class="left-nav-links-img" src={dice} alt="" /></a></div>
            <div id="left-nav-five" class="links"><a href="https://instagram.com"><img class="left-nav-links-img" src={blackJack} alt="" /></a></div>
        </div>
        <div className="globe-container">
                <Globe width={100} height={100} />
            </div>
        </div>
    )
}
